const binary = $input.first().binary;

if (!binary || !binary.data) {
  throw new Error('No video binary data found');
}

const videoData = binary.data;
const metadata = {
  fileName: videoData.fileName || 'video.mp4',
  mimeType: videoData.mimeType || 'video/mp4',
  fileSize: videoData.fileSize || 0,
  fileExtension: (videoData.fileName || '').split('.').pop() || 'mp4'
};

// Validate file type
const validTypes = ['video/mp4', 'video/quicktime', 'video/x-msvideo', 'video/webm', 'video/x-matroska'];
const validExtensions = ['mp4', 'mov', 'avi', 'webm', 'mkv'];

if (!validTypes.includes(metadata.mimeType) && !validExtensions.includes(metadata.fileExtension.toLowerCase())) {
  throw new Error(`Invalid video format: ${metadata.mimeType}`);
}

// File size check (128GB max for YouTube)
const maxSize = 128 * 1024 * 1024 * 1024;
if (metadata.fileSize > maxSize) {
  throw new Error(`File too large: ${metadata.fileSize} bytes (max: 128GB)`);
}

const inputData = $('Initialize Upload Session').first().json;

return [{
  json: {
    ...inputData,
    videoMetadata: metadata,
    validationStatus: 'passed'
  },
  binary: binary
}];

const inputData = $input.first().json;
const videoMeta = inputData.videoMetadata || {};

// Prepare content context for AI
const contentContext = {
  projectName: inputData.projectName,
  fileName: videoMeta.fileName,
  fileType: videoMeta.mimeType,
  targetAudience: inputData.targetAudience,
  language: inputData.language,
  estimatedDuration: videoMeta.fileSize ? Math.round(videoMeta.fileSize / (1024 * 1024 * 5)) + ' minutes (estimated)' : 'unknown'
};

return [{
  json: {
    ...inputData,
    contentContext: contentContext
  },
  binary: $input.first().binary
}];

const inputData = $input.first().json;
const aiOutput = inputData.output || '{}';

let aiMetadata = {};
try {
  const jsonMatch = aiOutput.match(/\{[\s\S]*\}/);
  if (jsonMatch) {
    aiMetadata = JSON.parse(jsonMatch[0]);
  }
} catch (e) {
  aiMetadata = {
    title: inputData.contentContext.projectName || 'Untitled Video',
    description: 'Video uploaded via automation.',
    tags: ['video', 'content'],
    category: 'Science & Technology',
    categoryId: '28'
  };
}

// Map category names to YouTube category IDs
const categoryMap = {
  'Film & Animation': '1',
  'Autos & Vehicles': '2',
  'Music': '10',
  'Pets & Animals': '15',
  'Sports': '17',
  'Travel & Events': '19',
  'Gaming': '20',
  'People & Blogs': '22',
  'Comedy': '23',
  'Entertainment': '24',
  'News & Politics': '25',
  'Howto & Style': '26',
  'Education': '27',
  'Science & Technology': '28',
  'Nonprofits & Activism': '29'
};

const categoryId = categoryMap[aiMetadata.category] || aiMetadata.categoryId || '28';

// Get original context data
const contextData = $('Prepare AI Context').first().json;

return [{
  json: {
    ...contextData,
    youtubeMetadata: {
      title: aiMetadata.title?.substring(0, 100) || 'Untitled',
      description: aiMetadata.description || '',
      tags: Array.isArray(aiMetadata.tags) ? aiMetadata.tags.slice(0, 15) : [],
      category: aiMetadata.category || 'Science & Technology',
      categoryId: categoryId
    }
  },
  binary: $('Prepare AI Context').first().binary
}];

const uploadResult = $input.first().json;
const inputData = $('Merge Publish Settings').first().json;

const videoId = uploadResult.id || uploadResult.videoId || 'unknown';
const videoUrl = `https://youtu.be/${videoId}`;

return [{
  json: {
    uploadId: inputData.uploadId,
    videoId: videoId,
    videoUrl: videoUrl,
    title: inputData.youtubeMetadata.title,
    description: inputData.youtubeMetadata.description,
    tags: inputData.youtubeMetadata.tags,
    category: inputData.youtubeMetadata.category,
    categoryId: inputData.youtubeMetadata.categoryId,
    privacyStatus: inputData.privacyStatus,
    publishAt: inputData.publishAt || 'immediate',
    playlistId: inputData.playlistId,
    uploadStatus: 'completed',
    uploadedAt: new Date().toISOString()
  }
}];

