// Aggregate all uploaded items for summary
const items = $input.all();

const summary = {
  totalUploads: items.length,
  successCount: items.filter(i => i.json.uploadStatus === 'completed').length,
  videos: items.map(i => ({
    videoId: i.json.videoId,
    title: i.json.title,
    url: i.json.videoUrl
  })),
  generatedAt: new Date().toISOString()
};

return [{ json: summary }];
